import React from 'react'
import Topbar from '../../components/Topbar'
function Home() {
  const [userLogged,setUserLogged] = useState(false)
  return (
    <div>
        <Topbar />
        {
          userLogged ? <> <h2>H1</h2> </> : <h2>H2</h2>
        }
    </div>
  )
}

export default Home
